import axios from 'axios';

interface jsonType {
    id:number,
    data:string,
    flag:boolean
}

export const ApiGet_Simple = (URL:string):jsonType[] => {


    let return_Json:jsonType[] = [];

    axios
        .get<jsonType[]>(URL)
        .then((results) => {
            return_Json = results.data;
            console.log(return_Json);

            return return_Json;
        })
        .catch((error) => {
            console.log('通信失敗');
            console.log(error.status);

        });


    return return_Json;
};
